import React from "react";
import {Link, Outlet} from 'react-router-dom';

function Game(props) {
  return (
    <div className="gameCard">
      <a className="cursor" onClick={handleClick}>
        <img className="gameCard" src={`./games/${props.src}`} alt={props.name}/>
      </a>

    </div>
  );
}

export default Game;
